perspectives.style:
@settings {
  template: systems;
  connection-color: #c6c6c6;
  element-size: 63;
  font-size: 32;
  font-color: #000000;
  theme: light;
  layout: static;
  layout-grid: false;
  include: same-connection, -connection, --connection, -connection, --connection, --connection, --connection, undefined-connection, element, loop;
  direct-decorations: false;
  culling: false;
}

/* state variable */
element["element type"="state variable"] {
  color: #97d7cd;
}

/* process */
element["element type"="process"] {
  color: #dedede;
}

/* management action */
element["element type"="lever"] {
  color: #fdc171;
}

#background {
  image-url: url(https://github.com/caseyhelgeson/LBI.MM/blob/main/background.jpg?raw=true);
  layer: background;
  shape: rectangle;
  size: 1300;
  color: transparent;
  image-size: contain;
  image-resolution: original;
  label-visibility: none;
}

/* climate/ocean driver */
element["element type"="ocean drivers (not the best name)"] {
  color: #c6c7e1;
}
